VALUES (1, 'Майстер з ремонту автомобілів',
        'це фахівець, який займається діагностикою, ремонтом та обслуговуванням автомобілів.', 3,
        150, 50),
       (2, 'Майстер з покраски',
        'Потрібен кваліфікований майстер з покраски автомобілів. Вимоги: досвід роботи не менше 3 років, вміння працювати з різними видами фарб, знання правил зберігання фарб та інструментів.',
        3, 200, 0),
       (3, 'Електрик автомобілів',
        'Потрібен електрик автомобілів з досвідом роботи. Вимоги: знання електросхем, здатність швидко визначати та усувати несправності, досвід встановлення електрообладнання.',
        3, 180, 0),
       (4, 'Менеджер сервісу',
        'Потрібен менеджер сервісу для організації роботи автосервісу. Вимоги: вміння працювати з клієнтами, знання ринку послуг автосервісів, вміння керувати командою.',
        2, 250, 0),
       (5, 'Директор відділу',
        'Керівник відділу, який відповідає за стратегію та операції організації', 1, 300, 0),
       (6, 'Бухгалтер', 'Фахівець, який відповідає за ведення бухгалтерського обліку організації',
        1, 100, 50),
       (7, 'Кадровик', 'Фахівець, який відповідає за підбір, найм та збереження кадрів організації',
